import React, { Component } from "react";

export default class Employees extends Component {
  //States

  //Methods

  //Render
  render() {
    return (
      <div class="container">
        <table class="table table-hover">
          <thead>
            <tr>
              <th>Image</th>
              <th>Name</th>
              <th>Phone</th>
              <th>Email</th>
              <th>DOB</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Image</td>
              <td>John</td>
              <td>Doe</td>
              <td>Phone</td>
              <td>Email</td>
              <td>DOB</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}
